import binascii

# Example HEX string (truncated for illustration)
hex_string = ""

print(len(hex_string)/2)
# Convert HEX string to bytes
img_bytes = binascii.unhexlify(hex_string)

# Write to a JPEG file
with open("output_image.jpg", "wb") as f:
    f.write(img_bytes)

print("JPEG image saved as output_image.jpg")
